-- Table structure for accounts
-- ----------------------------
DROP TABLE IF EXISTS `accounts`;
CREATE TABLE `accounts` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userid` varchar(256) NOT NULL DEFAULT '' COMMENT '账号',
  `reuserid` varchar(256) DEFAULT NULL COMMENT '修改后的账号',
  `username` varchar(128) DEFAULT NULL COMMENT '用户名',
  `password` varchar(50) NOT NULL DEFAULT '' COMMENT '密码',
  `sex` tinyint(3) DEFAULT '0',
  `phonecode` varchar(30) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `productid` int(11) DEFAULT '0' COMMENT '来自哪个产品或游戏',
  `channelid` varchar(64) DEFAULT NULL COMMENT '渠道编号',
  `belongto` int(11) DEFAULT '0' COMMENT '归属哪个渠道',
  `permit` varchar(256) DEFAULT NULL COMMENT '渠道后缀',
  `rtime` datetime DEFAULT NULL COMMENT '注册时间',
  `ltime` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '最后一次登录时间',
  `registerip` varchar(30) DEFAULT NULL COMMENT 'ip',
  `state` tinyint(3) DEFAULT '0' COMMENT '状态',
  `registerfrom` tinyint(3) DEFAULT '0' COMMENT '账号来源（游戏或网站）',
  `money` int(11) DEFAULT '0' COMMENT '账号拥有的货币',
  `freeze` bigint(11) DEFAULT '0' COMMENT '冻结截至时间',
  `deviceos` varchar(50) DEFAULT NULL COMMENT 'os',
  `osversion` varchar(50) DEFAULT NULL COMMENT '系统版本号',
  `deviceserial` varchar(50) DEFAULT NULL COMMENT 'IMEI',
  `deviceudid` varchar(128) DEFAULT NULL COMMENT 'udid',
  `devicemac` varchar(50) DEFAULT NULL COMMENT 'mac',
  `deviceua` varchar(300) DEFAULT NULL COMMENT 'ua',
  `screenwidth` int(11) DEFAULT '0' COMMENT '屏幕分辨率宽',
  `screenheight` int(11) DEFAULT '0' COMMENT '屏幕分辨率高',
  `codeversion` varchar(50) DEFAULT NULL COMMENT '版本号',
  `pwdstate` tinyint(3) DEFAULT '0' COMMENT '密码状态',
  `freezeday` bigint(11) DEFAULT '0' COMMENT '冻结日期',
  `logincount` int(11) DEFAULT '0' COMMENT '登录次数',
  `channelsub` varchar(128) DEFAULT NULL COMMENT '子渠道',
  `active_code` varchar(64) DEFAULT NULL COMMENT '激活码',
  PRIMARY KEY (`id`),
  KEY `user_id` (`userid`(255)),
  KEY `user_psw` (`password`),
  KEY `userid_psw_index` (`userid`(255),`password`),
  KEY `index_phone` (`phonecode`)
) ENGINE=InnoDB AUTO_INCREMENT=1000173 DEFAULT CHARSET=utf8 ROW_FORMAT=REDUNDANT;

